Here is a sample Spark job to calculate the hit rate for onsite attributed data:

```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import org.apache.spark.api.java.function.VoidFunction;
import scala.Tuple2;

import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        // Initialize Spark session
        SparkSession spark = SparkSession.builder()
                .appName("HitRateCalculator")
                .master("local[*]")
                .getOrCreate();

        // Load onsite attributed data
        JavaRDD<String> onsiteData = spark.read()
                .textFile("onsite_data.txt")
                .javaRDD();

        // Load top frequent queries
        JavaRDD<String> topQueries = spark.read()
                .textFile("top_queries.txt")
                .javaRDD();

        // Filter onsite data to only include queries present in top queries
        JavaRDD<String> filteredOnsiteData = onsiteData.filter(new Function<String, Boolean>() {
            @Override
            public Boolean call(String line) throws Exception {
                String query = line.split(" ")[0];
                return topQueries.filter(new Function<String, Boolean>() {
                    @Override
                    public Boolean call(String topQuery) throws Exception {
                        return topQuery.equals(query);
                    }
                }).count() > 0;
            }
        });

        // Create a cache to store queries and their last access time
        final Map<String, Long> queryCache = new HashMap<>();

        // Calculate hit rate
        long cacheMisses = 0;
        long cacheHits = 0;
        filteredOnsiteData.foreach(new VoidFunction<String>() {
            @Override
            public void call(String line) throws Exception {
                String query = line.split(" ")[0];
                long timestamp = Long.parseLong(line.split(" ")[1]);

                // Check if query is in cache
                if (queryCache.containsKey(query)) {
                    // Check if query is still in cache (within 12 hours)
                    if (timestamp - queryCache.get(query) <= 12 * 60 * 60 * 1000) {
                        cacheHits++;
                    } else {
                        cacheMisses++;
                        queryCache.put(query, timestamp);
                    }
                } else {
                    cacheMisses++;
                    queryCache.put(query, timestamp);
                }
            }
        });

        // Calculate hit rate
        double hitRate = (double) cacheHits / (cacheHits + cacheMisses);
        System.out.println("Hit rate: " + hitRate);

        // Stop Spark session
        spark.stop();
    }
}
```

This job first filters the onsite attributed data to only include queries present in the top frequent queries dataset. Then, it creates a cache to store queries and their last access time. For each record in the filtered onsite attributed data, it checks if the query is in the cache and if it's still within the 12-hour window. If it is, it increments the cache hits counter; otherwise, it increments the cache misses counter and updates the query's last access time in the cache. Finally, it calculates the hit rate by dividing the number of cache hits by the total number of cache hits and misses.

